import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import { SocketProvider } from './SocketProvider'; // Adjust the import path
import { AuthProvider, useAuth } from './AuthProvider'; // Assuming you have an AuthProvider

const Root = () => {
  const { authUser } = useAuth(); // Get the authenticated user

  return (
    <SocketProvider authUser={authUser}>
      <App />
    </SocketProvider>
  );
};

ReactDOM.render(
  <AuthProvider>
    <Root />
  </AuthProvider>,
  document.getElementById('root')
);
